import {useState} from 'react';
import './App.css';
import Homepage from './homepage';
import {supabase} from './supabaseClient';

function Library(){
  const [mySource, setMySource] = useState([]);
  async function getBooks(){
    let { data: sources,} = await supabase
    .from('finalproject')
    .select('*')
  setMySource(sources);
  }
  setMySource();
  return (
    <table>
      {
        mySource.map(b => (
          <tr>
            <td>{b.source}</td>
            <td>{b.isbn}</td>
            <td>{b.description}</td>
          </tr>
        ))
      }
    </table>
  );
}

function App() {
  return (
    <div className="App">
      <Library />
      <Homepage />    
    </div>
  );
}

export default App;
